::: {.column-page}

Fom. 15. februar 2025 har [Dapla Lab](../../../statistikkere/dapla-lab.qmd) vært arbeidsbenken for SSB-ere som jobber med data på Dapla. I dette viser vi noen interessante tall om hvor mange som jobber på plattformen. 

@fig-plot-daily viser antall maksimalt antall unike brukere av Dapla Lab ila en dag. Figuren er en oversikt over perioden **25. februar** tom. **29. mars 2025**. 

::: {#cell-fig-plot-daily .cell execution_count=1}

